import classes from './ProfileInfo.module.css'
import userAva from '../../../assets/images/avatar.png'

const ProfileInfo = (props) => {
    debugger
    return (
        <div className={classes.content}>
            <div>
                <img src="https://semantica.in/wp-content/uploads/2018/08/av-427845-1.png" alt=""/>
            </div>
            <div className={classes.avatar}>
                <img src={props.profile.photos.large != null ? props.profile.photos.large : userAva} alt="ava "/>
            </div>
            <div className={classes.description}>
                <h3>{props.profile.fullName}</h3>
                <h2>Description and status</h2>
            </div>
        </div>
    );
}

export default ProfileInfo;
